import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';
import FormControl from '@mui/material/FormControl';
import { InputLabel, MenuItem, Grid, Select as MuiSelect } from '@material-ui/core';
import paddock from '../services/paddock.png'

export default function Farms(props) {
    const [open, setOpen] = React.useState(false);
    const [farm, setfarm] = React.useState("");
    
    const [img, setimg] = React.useState('');
    const [img1, setimg1] = React.useState('');
    var changefarm = 0;
    var flag=0;
    const arr = {};
    const [field, setfield] = React.useState("CATEGORY")
    const [fieldfarm, setfieldfarm] = React.useState("")
    const [subfield, setSubfield] = React.useState('NONE');
    const [fieldval, setfieldval] = React.useState("CATEGORY")
    const [subfieldval, setSubfieldval] = React.useState('NONE');
    const [c, setc] = React.useState({});

    const farm_options =[
        {id:'1', title:'Farm1'},
        {id:'2', title:'Farm2'},
     
    ]
    const paddock_options =[
        {id:'1', title:'Paddock1'},
        {id:'2', title:'Paddock2'},
     
    ]

    const handleChange = (event, value) => {
        setfarm(event.target.value);
        changefarm = event.target.value;
        setfieldval(value.props.children)
        
            setSubfieldval("");
            setfieldfarm("");
            setimg1(paddock);
        
       
    };

    const handleChange1 = (event) => {
        const name = event.target.name;
        const value = event.target.value;
      
        if (name == "Farm") {
            setfieldfarm(value + " : ");
            flag=1;
        }
        else {
            setSubfieldval(value);
        }
    }
    const handleClickOpen = () => {
        if (!restart) {
            setOpen(true);
        }
    };

   



    const { name, label, value, onChange, restart } = props;
    return (
        <div>
            <Button open={false} color="inherit" onClick={handleClickOpen} size="large" fullWidth="true">
                <Grid container spacing={0}>
                    <Grid item xs={0} sm={0} md={0}>
                        <img src={img} className="img" alt="tractor"></img>
                    </Grid>
                    <Grid item xs={6} md={3}>
                        <p>{field}</p>
                        <InputLabel>{subfield}</InputLabel>
                     </Grid>
                </Grid>
            </Button>
            
                               <Box component="form" sx={{ display: 'grid' }}>
                        <FormControl variant="standard" sx={{ m: 1, minWidth: 420 }}>
                            <InputLabel>{label}</InputLabel>
                            <MuiSelect
                                label={label}
                                name={name}
                                value={farm}
                                onChange={handleChange}
                                displayEmpty>
                                
                                {
                                    farm_options.map(
                                        item => (<MenuItem key={item.id} value={item.id}>{item.title}</MenuItem>)
                                    )
                                }
                            </MuiSelect>
                        </FormControl>
                        <FormControl variant="standard" sx={{ m: 1, minWidth: 420 }}>
                            <InputLabel>{label}</InputLabel>
                            <MuiSelect
                                label={label}
                                name={name}
                                value={farm}
                                onChange={handleChange}
                                displayEmpty>
                                
                                {
                                    paddock_options.map(
                                        item => (<MenuItem key={item.id} value={item.id}>{item.title}</MenuItem>)
                                    )
                                }
                            </MuiSelect>
                        </FormControl>
                    </Box>
               
        </div>
    );
}
